import React from "react";
import { Outlet } from "react-router-dom";
import { Header } from "../components/Header";

const PrivateRouter = () => {
  return (
    <div className="flex">
        <div className="sticky top-0 w-full"><Header /></div>

        <div><Outlet /></div>
    </div>
  );
}

export default PrivateRouter;
